import React from 'react';

var Wrapper = React.createClass({
    getInitialState() {
        return {
            scrollTop: 0
        }
    },
    render() {
        return (
            <div>
                <text scrollTop={ this.state.scrollTop } handleScroll={ this.handleScroll } />
                <text scrollTop={ this.state.scrollTop } handleScroll={ this.handleScroll } />
            </div>
        );
    },
    handleScroll( scrollTop ) {
        this.setState({ scrollTop });
    }
});


function App() {
  return (
    <div className="App" style={{height:"1500px"}} >
      <Search
        style={{
          right: 0,
          position: "relative",
          top: "50px",
          marginLeft: "100",
        }}
      />
      <Wrapper/>
    </div>
  );
}

export default App;
